import React from "react";
import {Container} from 'react-bootstrap'

let cardFood = ({items}) => {

    return (
        <div>
            <div className="foodCart">
                <Container>
                    <div className="content">
                    {
                        items.length >= 1 ? (
                            items.map((data) => {
                                <div  className="cart">
            
                                <img src="dinner.jpg" />
                                <h4> dinner </h4>
                                <span> 20 </span>
                                <span className="butt">
                                   Order now
                                </span>
                          </div>
                            })
                        ) : ""
                    }
                    </div>
                </Container>
            </div>
        </div>
    )
}

export default cardFood
